        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](22, "Born in badayun, uttar pradesh. He received his initial training from his maternal grand-uncle, ustad nissar hussain khan (1909\u20131993). He is also the nephew of ustaad ghulam mustafa khan. Rashid khan gave his first concert at age eleven, and the following year, 1978, he performed at an itc concert in delhi. In april 1980, when nissar hussain khan moved to the itc sangeet research academy (sra), calcutta, rashid khan also joined the academy at the age of 14. By 1994, he was acknowledged as a musician (a formal process) at the academy. Rashid khan includes the slow elaboration in his vilambit khayals in the manner of his maternal grand-uncle and also developed exceptional expertise in the use of sargams and sargam taankari (play on the scale). He is influenced with the style of amir khan and bhimsen joshi. He is also a master of the tarang like his guru but sings them in his own manner, preferring the khayal style rather than the instrumental stroke-based style for which nissar hussain was famous. There is no imitation of instrumental tone. He has done playback for a number of songs in the bollywood industry and done innumerable number of concerts and live shows. Some his most famous songs are barsaat sawan, assalatul, ae ri mai re, sakhi ri, bhara badara, jheeni re jheeni, allah hi rehem, aaoge jab hum saajna, tore bina more chain nahi and the list is endless! He has been honoured with the padma shri in the year 2006. He also received the following awards : Sangeet natak academy awards (2006) Global indian music academy awards (gima) Maha sangeet samman award (2012) Mirchi music awards (2013)");
