        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](41, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](42, "He started his career from a theatre group named \u2018Rangakarmi\u2019 in Kolkata.He began his film career in 1996 with an appearance in Maachis before acting in several Bengali films in the early 2000s.From the small screen to the big screen,we have seen him showcase his versatility across Tollywood and Bollywood. He is known for his excellence that he shows while delivering the most challenging roles.The \u2018not so stereotypical\u2019 charismatic performer that Sharma is, he has risen his way up to the top when at today\u2019s day and age we cannot imagine anyone else in his place but him. Out of the innumerable feathers in his cap, some of his best known films that left a lasting impression on his audience are Khosla Ka Ghosla, Ishqiya, No One Killed Jessica, Chillar Party, The Dirty Picture, Luv Shuv Tey Chicken Khurana and many more. Out of his endless list of achievements some of his recent projects were Shudh Desi Romance, MS Dhoni, Hindi medium, Begum Jaan, Super 30, Mardaani 2, Batla House, Special 26, B.A. Pass, Tanu Weds Manu Returns, Dabangg 3, Toilet: Ek Prem Katha,India\u2019s Most Wanted. He received immense amount of recognition after Bajrangi Bhaijaan. His most recent tv series Patalok left the audience spellbound and yet again proved his adaptability in turning every project that he touches into gold.");
