        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](52, "Has written thousands of episodes on television in the last 27 years. Major works among them are: \u2013 \u2018swabhimaan\u2019 \u2018kittie party\u2019 & sarkarr, all based on concepts by ms. Shobhaa de. \u2018Itihaas\u2019 ekta kapoor\u2019s first daily soap opera.Jassi jaisi koi nahi. Kituu sab janti, laagi tujh se lagan, sea hawks, saaya, laut aao trisha.. Mere angane mein crime patrol and many more\u2026 Feature films :- story, screenplay & dialogues Written the story & screenplay of hindi feature film, \u2018do rahaien\u2019, \u2018ishq-vishq\u2019, \u2018for tips\u2019, The malayalam film \u2018millennium stars\u2019, \u2018mast\u2019 and many more! Written the screenplay for the film \u2018vibhatsa\u2019 directed by jayaraj. Co-written story & screenplay for the film \u2018khap\u2019. Ashutosh gowarikar\u2019s \u2018swadesh\u2019, written for zee\u2019s yule love stories in 1995. Teacher at \u2013 Ftii pune. Whistling woods international, mumbai. Main tutor and course director of ftii\u2019s 24 week writing for tv & web course. Visiting faculty at the jilin animation institute in changchun, china Xi\u2019an jiaotong-liverpool university suzhou, china.");
