        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](61, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](62, "Antara Biswas better known by her stage name Mona Lisa, is an Indian actress. She has mostly acted Bhojpuri films, and has also appeared in Hindi, Bengali, Odia, Tamil, Kannada and Telegu films. She was a contestant of the show Bigg Boss 10. She made her debut in Bollywood with Blackmail, starring Ajay Devgn and Suniel Shetty. She is known for portraying the part of Mohana in Nazar. She was last seen as Madhulika Chaudhary in Nazar 2, the second season of Nazar. She has been the star of various television shows and films like Jayate, Tauba tauba, Ek hi bhool, Jackpot, Kaafila, Money hai toh honey hai, Vathiyar, Nagaram, Silambattam, To the London calling, Hamilton palace, Boni, Royal Utsav, Kadhalukku Marannamillai, En Peyar Kumarasamy, Badla hindustani ka and many more! She has starred in many Bhojpuri superhit films like Bhole Shankar, Hum hai khalnayak, Dulha Albela, Hum Bahubali, Sindur daan, Ek aur kurukshetra, Dharmatma, Bhojpuriya Don, Elan e jung, Hamaar Devdas, Maafia, Pratibandh, Pocket gangsters, Prem Leela, Saaiya Toofani, Sarkar Raj, Rakhtbhoomi, Suhag, Jai Shree Ram to name a few! The award winning multi talented artist and new judge of Netwood Stars Hunt is also a degree holder of Sanskrit!");
