        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](71, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](72, "Sugandha Santosh Mishra is an Indian playback singer and television presenter. She played the famous teachers character \"Vidyavati\" in The Kapil Sharma Show as a comedian. She is also known for mimicking Lata Mangeshkar. She was the finalist in the reality show Hero Honda: Sa Re Ga Ma Pa Singing Superstar. She was a contestant on The Great Indian Laughter Challenge. She is classically trained by her grandfather, Pt. Shankar Lal Mishra, a disciple of Ustaad Amir Khan Sahib. Sugandha is the fourth generation of her family into singing and belongs to the Indore gharana. She has a master's degree in music and is pursuing a doctorate in Music. Mishra started her career as a radio jockey in BIG FM, India, for a prime-time morning show. She has sung many jingles, bhajans and playback in documentaries, plays and short films. She was the third runner-up in the reality show Zee Hero Honda : Sa Re Ga Ma Pa Singing Superstar. She was a finalist of The Great Indian Laughter Challenge. Sugandha, apart from giving voice to songs in Bollywood Movies like Shree and Kamaal Dhamaal Malamaal, has done many singing and comedy shows and has acted and hosted television shows. Sugandha was invited to perform on actor Dilip Kumar's 90th birthday. We have seen her across various television shows, comedy shows, reality tv and films as well. We saw her in The Great Indian Laughter Challenge, Don't Worry Chachu, Comedy circus, Sa re ga ma pa, Family antakshari,Baal veer, The Kapil sharma show, The voice of India (season 2), The drama company, Dance plus and Gangs of Filmistan to name a few. The multi talented singing sensation is currently working on some very interesting upcoming projects and is one of the new judges of Netwood Stars Hunt Season 1.");
