        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](82, "Indraneil Sengupta was a finalist of Gladrags Manhunt contest in the year 1999. Starred in multiple commercials for brands like Tata, Vip, Frenchie, Aquafina and lots more! He became a heartthrob for the nation very quickly, and started doing music videos too! We have seen him in movies like Kahaani, Mumbai Salsa, Autograph,1920, Mishor rohosyo, Calendar girls, Mulk, Sargoshiaan and so many more! Awards \u2013 Anandalok fresh face of the year (Male) award in 2009 for Anshumaner Chhobi. 2008 ITA award for Glamour face of the year (Male). 2014 Filmfare award for best supporting actor \u2013 Mishor rohosyo.");
