        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](91, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](92, "Puja started her television career with the show \u201CKahani Humare Mahabharat Ki\u201D on the channel 9x. Her debut film was \u201CMacho Mastaana\u201D. We also saw her on \u2018Devon Ke Dev Mahadev\u201D as Parvati. She has acted in multiple movies like Challenge 2, Hoichoi Unlimited, Bhalobasha Bhalobasha 2, Rajdhani Express. Great Grand Masti, 3 Patti, Loveria and many more. From small screen to big screen, she has made her mark in the industry in a very glamorous way. We have also seen her in \u201CJhalak Dikhla Ja Season 7\u201D, the tv series \u201CPAAP\u201D, \u201CDev\u201D, \u201CTujh Saang Preet Lagai Sajna\u201D, \u201CShrimati Swara Raje Deshmukh Sarvggun Sampanna\u201D and \u201CComedy Dangal\u201D on the channel &tv. She really left a huge impact on her audience when she appeared in the reality show \u201CBig Boss \u2013 Bangla\u201D, she made special appearances in \u2018The Kapil Sharma Show\u201D and \u201CComedy Circus\u201D. She\u2019s a very versatile actress specialized in action, comedy, mythology and drama. She\u2019s received a lot of recognition and appreciation for the work she has done in the industry.");
