        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](102, "Mishra made her acting debut as a child at the tender age of five with the film \u201Csabata maa\u201D. She made her debut in ollywood with the film \u201Cthukool\u201D and since then she has starred in more than 10 odia feature films.She appeared in multiple television shows. She gained nationwide popularity with \u201Cbitti business wali\u201D. We have also seen her in mtv\u2019s \u201Cage of space\u201D part 2, zee tv\u2019s \u201Cindia\u2019s best cinestars ki khoj\u201D, star bharat\u2019s \u201Cjai kanhaiya lal ki\u201D and many more.Prakruti has acted in numerous films as well, and left a lasting impression on her audience!We have seen her in \u201Chello arsi\u201D, \u201Cmitha mitha\u201D, \u201Ckaun kitna paani mein\u201D, \u201Comm\u201D, \u201Cbindas romeo\u201D and many more films. Mishra has won millions of hearts with her incredible acting. She has recently won the \u201Cnational film award\u201D for \u201Chello arsi\u201D, she also won \u2013 \u201Codisha state film award\u201D for \u201Csasu ghara chali jibi\u201D and \u201Codisha music awards as the \u201Codia sensation of the year\u201D! The multilingual, multi-talented judge of netwood is also a classically trained odissi dancer.");
