        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](112, "Pandit Bickram Ghosh is an illustrious name in Indian music. He is a renowned classical Tabla player who performs Hindustani classical music and Indo-fusion music. He is also an acclaimed music composer and director.He has performed all over the world for years with the greatest of names like Pandit Ravi Shankar, Ustad Ali Akbar Khan, Ustad Amjad Ali Khan, Pt Shivkumar Sharma, and so on. He has several collaborative and solo albums to his credit. His contribution to Indian film music is also impressive.");
