        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](162, "Entrepreneur Arijit Dutta is a man on a mission to realize his vision of a re-energized Bengali film industry. As the Managing Director of Priya Entertainments Pvt Ltd (PEPL), owner of the iconic PRIYA Cinema and Bioscope brands,he is leaving no stone unturned to provide a new lease of life to the old Bengali film and entertainment culture. PEPL has also diversified into Eco Tourism. Apart from that, Mr Dutta also heads the Eastern Fashion Legacy that seeks to highlight Eastern India\u2019s beautiful heritage of weaves and designs. Mr Dutta is the co owner of Jalpaiguri Royals, a celebrity cricket team too.");
