        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](177, "Ujjaini Mukherjee is a singer well-known in India. She has sung in many languages like Hindi, Bengali, English, Bhojpuri, Marathi, Kannada, Telugu, Assamese, and Odia. Having been introduced to music at the tender age of two and a half years she went through rigorous training in Hindustani Classical Music under Pt Ajoy Chakrabarty and Pt Biresh Roy for many years. She has participated in many singing talent hunt shows at the national level like Indian Idol (2004), Jo Jeeta Wohi Super Star (2008), Music Ka Maha Muqqabla (2010) and won many like Sa Re Ga Ma Pa Challenge 2005 (Finalist) and Sa Re Ga Ma Pa Ek Main Aur Ek Tu (Winner). She has also been nominated for many prestigious music awards like Mirchi Music Awards and the Filmfare Awards East many times over the years and is the winner of several awards at the national level.");
