        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](187, "The beautiful Chitrangada Shatarupa is a well-known Bengali actor. Her roles in Stories by Rabindranath Tagore (2015 directed by Anurag Basu), Tikli and Laxmi Bomb, Shantilal O Projapoti Rohoshyo,Tottaa Pataaka Item Maal, Ahare Mon (2018) are quite memorable. Hailing from a Bengali family well-known for its rich cultural inclination, she is a bundle of talent herself with a promising future. At present, she can be seen in Karkat Rogue (2020 Zee5 original web series).");
