        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](196, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](197, "Dibyendu Mukherjee is a well-known professional singer and music director in Bengali and other regional film industries. He has sung in many films like Phir Kabhi, Aa Dekhen Zaraa, Ugly Aur Pagli,Ashchorjyo Prodeep (Astonishing Lamp), Pankh, Morning Walk, Jaatishwar, Jodi Love Dile Na Prane, Chocolate, Onyo Boshonto, Abosheshey, Chorabali, Messi, Jyesthoputro, Bornoparichay, and many more. He has also directed music for Nahanyate, Messi, Chorabali, Onyo Boshonto, Audition, Mrs Sen, Daab Chingri, Daawat e Biriyani, and more. He has also performed in many renowned national as well as international music festivals like NH7, NABC, Birmingham Music Convention, Rajasthan Folk Festival, New Orleans Jazz Centenary Festival and many more.");
