        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](205, "Sahana Bajpaie");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](206, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](207, "Sahana bajpaie is a bengali-indian singer-songwriter from santiniketan and one of the most prominent contemporary rabindra sangeet and bengali baul song vocalists in india. By the age of 13,she started singing. In 2007, she released her debut album notun kore pano bole, which was a collection of rabindra sangeet.in 2014, she released her second solo album shikhawr, with several musicians from west bengal. Sahana\u2019s second rabindra sangeet album ja bolo tai bolo was released in 2015and the latest solo album, mon bandhibi kamone in 2016. She has worked as a playback singer in various other films like hawa bodol, under construction, family album, ek je chilo raja and many more! From the wide array of songs that she has sung and performed, she truly won the hearts of millions across the globe. She was awarded at the uk parliament \u201Cthe bengal\u2019s pride award\u201D 2018 for her contribution to arts and culture. She now travels the world singing and collaborating with musicians from different countries, has published five critically acclaimed studio albums. She has performed at the royal albert hall, the royal festival hall, cambridge university, soas university of london, the london school of economics in the united kingdom, various cities in the us, the grassi museum leipzig, germany, sosnowiec music school, poland, the river festival, padova, italy, amsterdam, copenhagen, zurich, to name a few. She had spent quite a few years in dhaka, bangladesh and is now based in london. She teaches bengali language and literature at soas, university of london of which she is an alumna and a phd scholar in ethnomusicology at king\u2019s college london, university of london. She says \u2013 if she had her life to live again, she would not change much! The extensilvely talented singer, songwriter, composer and teacher sahana is now an esteemed judge of netwood!");
