        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](217, "Subhrajit Mitra is a talented film maker from Bengal. He started out as a documentary director for Doordarshan at the age of 18. Mitra\u2019s first work of fiction, a 52 min film, Vorai, won 4 Global Awards. His films and documentaries have been screened at 30 International Film Festivals and have won more than 12 International Awards. His documentaries are shown on prestigious channels like the National Geographic, History and the Discovery Channel. He has also scripted and directed many tele-films. His directorial ventures also include full length Bengali feature films like Mon Amour: Shesher Kobita Revisited, Aagunpakhi, Kakababu Trilogy, Chorabali, and so on.");
