        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](227, "Pankaj Seal is a passionate choreographer in the Bengali film industry. Within a span of a few years, he has gained wide industry experience. He has been associated with many Bengali films like Teen Patti, Bawal, Not A Dirty Film, Comrade, Sangabora, Babli, Uronchondi, Triangle, Soteroi September, O Bondhu Amar, Hari Ghosher Gowal, Jio Jamai and so on as a choreographer.");
